from functools import partial from itertools import islice def take(n, iterable): return list(islice(iterable, n)) def chunked(iterable, n): return iter(partial(take, n, iter(iterable)), []) def solve(s): h, w, *a = map(int, s.split()) (*a,) = chunked(a, w) ans = [] for i in range(h): for j in range(w - 1): if a[i][j] % 2 == 1: ans.append("{} {} {} {}".format(i + 1, j + 1, i + 1, j + 2)) a[i][j + 1] += 1 for i in range(h - 1): if a[i][w - 1] % 2 == 1: ans.append("{} {} {} {}".format(i + 1, w, i + 2, w)) a[i + 1][w - 1] += 1 ans += "{}
".format(len(ans)) + ans return "
".join(ans) n, m = map(int, input().split()) print(solve("{} {}
